import React from 'react';
import { Link } from 'react-router-dom';
import { motion } from 'framer-motion'; // Framer Motion importu
import './App.css';

function Page2({ inputValue2, setInputValue2 }) {
  const isInteger = (value) => Number.isInteger(Number(value)) && value !== '';

  return (
    <div className="App">
      {/* Logo */}
      <div className="logo-container">
        Leg1t
      </div>

      {/* Başlık */}
      <motion.h1 
        className="text-4xl mt-8 lg:text-[84px] font-extralight"
        initial={{ opacity: 0, y: -30 }} 
        animate={{ opacity: 1, y: 0 }} 
        exit={{ opacity: 0, y: -30 }}
        transition={{ duration: 0.5 }}
      >
        Who are <span className="font-bold">you</span>
        <span className="font-extrabold text-primary">?</span>
      </motion.h1>

      {/* Sayaç Animasyonu */}
      <div className="counter"><span className="other">2</span>/3</div>

      {/* Resimler */}
      <div className="image-container">
        <img src="/logo2.png" className="image" alt="Logo" />
        <img src="/logo2.png" className="image" alt="Logo" />
      </div>
      <img src="/logo2.png" className="image2" alt="Logo" />

      {/* Yeni Tasarım Soru Metni */}
      <motion.div
        className="question-container"
        initial={{ opacity: 0, y: 20 }}
        animate={{ opacity: 1, y: 0 }}
        exit={{ opacity: 0, y: 20 }}
        transition={{ duration: 0.5 }}
      >
        how many
        <p style={{ margin: '0px 4px', display: 'inline-block' }}>
          <span className="absolute" style={{ opacity: 1, transform: 'none', whiteSpace: 'nowrap' }}><motion.div
            className="question-container"
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            exit={{ opacity: 0, y: 20 }}
            transition={{ duration: 0.5 }}
          >Twitter </motion.div></span>
        </p>
        accounts do you have
        <span className="question-symbol">?</span>
      </motion.div>

      {/* Input Kutusu */}
      <input
        className="page1-input"
        type="number"
        value={inputValue2}
        onChange={(e) => setInputValue2(e.target.value)}
        placeholder="Enter a number"
        autoFocus
      />

      {/* Butonlar */}
      <div className="button-container">
        <Link to="/">
          <button className="previous-button">Back</button>
        </Link>
        <Link to={isInteger(inputValue2) ? "/hoşgeldiniz3" : "#"}>
          <button className="next-button" disabled={!isInteger(inputValue2)}>
            Next
          </button>
        </Link>
      </div>

      {/* Alt yazı ekleme */}
      <div className="footer-links">
        <span className='reality'>176057</span>
        <span className="footer-link"><br/><br/><br/>Matemask<span className='space'>_</span>Accounts</span>
        <span className="footer-divider">|</span>
        <span className='reality'>100089</span>
        <span className="footer-link"><br/><br/><br/>Twitter<span className='space'>_</span>Accounts</span>
        <span className="footer-divider">|</span>
        <span className='reality'>100147</span>
        <span className="footer-link"><br/><br/><br/>Telegram<span className='space'>_</span>Accounts</span>
        <span className="footer-divider">|</span>
        <span className='reality2'>23</span>
        <span className="footer-link"><br/><br/><br/>Unique<span className='space'>_</span>Users</span>
      </div>
    </div>
  );
}

export default Page2;
